import React from "react";
import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Header from "./Components/Main/Header/Header";
import Contents from "./Components/Main/Contents/Contents";
import AnotherPage from "./Components/Password/Password";

function App() {
  return (
    <div className="App">
      <Router>
        {/* 고정 헤더 */}
        <Header />
        <Contents />

        {/* 라우터로 페이지 전환 */}
          <Routes>
            <Route path="/another" element={<AnotherPage />} /> {/* 다른 페이지 */}
          </Routes>
      </Router>
    </div>
  );
}

export default App;
